    state= {
        orders:[],
        loading:true
    }

    componentDidMount() {
        axios.get('/orders.json')
            .then(res=>{
                const fetchedData = [];
                for(let key in res.data){
                    console.log(res.data[key])
                }
                this.setState({loading:false})
            })
            .catch(err=>{
                this.setState({loading:false})
            })
    }

    render() {
        return (
            <div>
                <Order/>
                <Order/>
            </div>
        )
    }

}

export default Orders;
